import React, { Component } from 'react'

export class Main_home extends Component {
  render() {
    return (
        <>
      <div className='bg-light shadow-sm rounded-1 p-4'>
        <header>
            <p className='h4 text-danger'>Mes services</p>
        </header>
      </div>
      </>
    )
  }
}

export default Main_home
